import React from 'react'

function nav() {


function isClassEnabled(){
            const classEnabled = window.localStorage.getItem("name");
            if(classEnabled == null){
                return "isDisabled";
            } else {
                return "navLabels";
            }
        }



//IsHomeEnabled?

    function isHomeEnabled(){
        const enabled = window.localStorage.getItem("name");
        if(enabled != null){
            return "/home";
        } else {
            return "#";
        }
    }


//IsCalendarEnabled?

    function isCalendarEnabled(){
        const enabled = window.localStorage.getItem("name");
        if(enabled != null){
            return "/calendarView";
        } else {
            return "#";
        }
    }

//IsAccountEnabled?

    function isAccountEnabled(){
        const enabled = window.localStorage.getItem("name");
        if(enabled != null){
            return "/myAccount";
        } else {
            return "#";
        }
    }

//IsLoginEnabled?

    function isLoginEnabled(){

        const enabled = window.localStorage.getItem("name");
        if(enabled == null){
            return "#";
        } else {
            return "/login";
        }
    }


//Change on scroll
    const [header, setHeader] = useState("header");

      const listenScrollEvent = event => {
        if (window.scrollY < 73) {
          return setHeader("header");
        } else if (window.scrollY > 70) {
          return setHeader("header2");
        }
      };

      useEffect(() => {
        window.addEventListener("scroll", listenScrollEvent);

        return () => window.removeEventListener("scroll", listenScrollEvent);
      }, []);





    return (
        <div className = "nav" className={header}>
            <ul className = "nav-ul">
                <li>
                    <a class = {isClassEnabled()} href={isHomeEnabled()}>home</a>
                </li>
                <li>
                    <a class = {isClassEnabled()} href={isCalendarEnabled()}>calendar view</a>
                </li>
                <li>
                    <a class = {isClassEnabled()} href={isAccountEnabled()}>my account</a>
                </li>
                <li>
                    <a class = {isClassEnabled()} href={isLoginEnabled()}>log out</a>
                </li>
            </ul>
        </div>

    )
}

export default nav
